import React, { useState } from 'react';
import { Upload, Info, RefreshCw } from 'lucide-react';
import { classifyImage } from '../utils/api';
import { motion } from 'framer-motion';

const ClassificationPage = () => {
  const [selectedImage, setSelectedImage] = useState(null);
  const [prediction, setPrediction] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [selectedModel, setSelectedModel] = useState('mobilenet_v3');
  const [error, setError] = useState(null);

  const models = [
    { value: 'mobilenet_v3', label: 'MobileNet V3', description: 'Lightweight and fast, ideal for mobile devices.' },
    { value: 'efficientnet_b0', label: 'EfficientNet B0', description: 'Balanced accuracy and efficiency.' },
    { value: 'resnet18', label: 'ResNet 18', description: 'Deep residual learning for image recognition.' },
    { value: 'resnet50', label: 'ResNet 50', description: 'Improved accuracy with deeper architecture.' },
    { value: 'squeezenet1_1', label: 'SqueezeNet', description: 'Compact model with minimal parameters.' },
    { value: 'mobilevit', label: 'MobileViT', description: 'Combines CNNs and Transformers for mobile devices.' },
  ];

  const handleImageUpload = async (event) => {
    const file = event.target.files[0];
    if (!file) return;

    setSelectedImage(URL.createObjectURL(file));
    setIsLoading(true);
    setError(null);

    try {
      const result = await classifyImage(file, selectedModel);
      setPrediction(result);
    } catch (error) {
      console.error('Error:', error);
      setError(`Error processing image: ${error.message}`);
    } finally {
      setIsLoading(false);
    }
  };

  const handleReset = () => {
    setSelectedImage(null);
    setPrediction(null);
    setError(null);
  };

  return (
    <div className="min-h-screen bg-gradient-to-r from-blue-50 to-indigo-50 bg-cover bg-center">
      <div className="max-w-5xl mx-auto p-8">
        <motion.h1
          className="text-4xl font-extrabold text-center text-gray-800 mb-8"
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          OCT Image Classification
        </motion.h1>

        {/* Model Selection */}
        <div className="mb-6">
          <label className="block text-gray-700 font-bold mb-2">Select Model</label>
          <select
            value={selectedModel}
            onChange={(e) => setSelectedModel(e.target.value)}
            className="w-full p-3 border rounded-lg bg-white shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500"
          >
            {models.map((model) => (
              <option key={model.value} value={model.value}>
                {model.label}
              </option>
            ))}
          </select>
          <p className="text-sm text-black mt-2">
            {models.find((m) => m.value === selectedModel)?.description}
          </p>
        </div>

        {/* Image Upload */}
        <div className="mb-6">
          <label className="block text-gray-700 font-bold mb-2">Upload OCT Image</label>
          <div className="border-2 border-dashed border-gray-300 rounded-lg p-8 text-center bg-white hover:border-blue-500 transition-all duration-300">
            <input
              type="file"
              accept="image/*"
              onChange={handleImageUpload}
              className="hidden"
              id="image-upload"
            />
            <label htmlFor="image-upload" className="cursor-pointer">
              <Upload className="mx-auto h-12 w-12 text-gray-400 mb-2" />
              <p className="mt-2 text-sm text-gray-600">Click or drag image to upload</p>
            </label>
          </div>
        </div>

        {/* Loading State */}
        {isLoading && (
          <div className="text-center py-4">
            <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-blue-600 mx-auto"></div>
            <p className="mt-2">Processing...</p>
          </div>
        )}

        {/* Error Message */}
        {error && (
          <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded-lg mb-6">
            {error}
          </div>
        )}

        {/* Results */}
        {selectedImage && !isLoading && (
          <motion.div
            className="grid md:grid-cols-2 gap-6"
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
          >
            <div>
              <h3 className="font-bold mb-2 text-gray-700">Original Image</h3>
              <img
                src={selectedImage}
                alt="Uploaded OCT"
                className="rounded-lg shadow-md w-full"
              />
            </div>
            {prediction && (
              <div className="bg-white p-6 rounded-lg shadow-md">
                <h3 className="font-bold mb-4 text-gray-700">Results</h3>
                <div className="space-y-2">
                  <p>
                    <span className="font-semibold">Condition:</span> {prediction.class}
                  </p>
                  <p>
                    <span className="font-semibold">Confidence:</span> {(prediction.confidence * 100).toFixed(1)}%
                  </p>
                  {prediction.gradcam && (
                    <div className="mt-4">
                      <h4 className="font-semibold mb-2 text-gray-700">Grad-CAM Visualization</h4>
                      <img
                        src={prediction.gradcam}
                        alt="Grad-CAM"
                        className="rounded-lg w-full"
                      />
                    </div>
                  )}
                </div>
              </div>
            )}
          </motion.div>
        )}

        {/* Reset Button */}
        {selectedImage && !isLoading && (
          <div className="text-center mt-6">
            <button
              onClick={handleReset}
              className="bg-gray-500 hover:bg-gray-600 text-white px-6 py-2 rounded-lg flex items-center justify-center mx-auto transition-all duration-300"
            >
              <RefreshCw className="mr-2" /> Reset
            </button>
          </div>
        )}
      </div>
    </div>
  );
};

export default ClassificationPage;
